import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Nav from "./components/Nav";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path="/" element={<h1>Heelo</h1>}>
            <Nav />
          </Route>
        </Routes>
      </BrowserRouter>

      <h1>hello Sir</h1>
    </div>
  );
}

export default App;
